      title: {
        text: "Basic Column Chart in React"
      },
      data: [{				
                type: "column",
                dataPoints: [
                    { label: "Apple",  y: 10  },
                    { label: "Orange", y: 15  },
                    { label: "Banana", y: 25  },
                    { label: "Mango",  y: 30  },
                    { label: "Grape",  y: 28  }
                ]
       }]
   }

   return (


      <div>
        <MyNavbar/>
        <Routes>
          {//<Route path="/" ><Redirect to="/dashboard" /></Route>
          }
          <Route path="/dashboard">
            {
              //TODO acess ":location" to display info
            }
            <Route path=":location" element={<LocationInfo locationName={location} />}></Route>
          </Route>
        </Routes>

        <CanvasJSChart options = {options}
            /* onRef = {ref => this.chart = ref} */
        />
      </div>
    );

}



export default App;
